import React, { useState, useRef, useEffect } from 'react';
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';
import 'gridstack/dist/gridstack.min.css';
import './App.css';
import './litegride.css';
import { GridStack } from 'gridstack';
import ReactResizeDetector from 'react-resize-detector';
import Tema from './assets/img/tema.jpg';

class ApexChart extends React.Component {
  constructor(props) {
    super(props);

    this.state = {

      series: [{
        name: "STOCK ABC",
        data: series.monthDataSeries1.prices
      }],
      options: {
        chart: {
          type: 'area',
          height: 350,
          zoom: {
            enabled: false
          }
        },
        dataLabels: {
          enabled: false
        },
        stroke: {
          curve: 'straight'
        },

        title: {
          text: 'Fundamental Analysis of Stocks',
          align: 'left'
        },
        subtitle: {
          text: 'Price Movements',
          align: 'left'
        },
        labels: series.monthDataSeries1.dates,
        xaxis: {
          type: 'datetime',
        },
        yaxis: {
          opposite: true
        },
        legend: {
          horizontalAlign: 'left'
        }
      },


    };
  }
}

function App(){


  const [chartDimensions, setChartDimensions] = useState({ width: null, height: null });
  const handleResize = (width, height) => {
    setChartDimensions({ width, height });
  };

  const getOptions = (type) => ({
    chart: {
      type,
    },
    responsive: {
      rules: [{
        condition: {
          maxWidth: '100%'
        },
        chartOptions: {
          legend: {
            enabled: false
          }
        }
      }]
    },
    title: {
      text: "GrÃ¡fico",
    },
    yAxis: {
      title: {
        text: 'Values',
      },
    },
    series: [
      {
        data: [1, 2, 1, 4, 3, 6],
      },
      {
        data: [2, 7, 0, 4, 6, 2],
      },
    ],
  });

  useEffect(() => {
    GridStack.init();

  }, []);


  return (
    <div className="App">
      <img className="App-logo" src={Tema} />
      <div className="grid-stack" >
        <div className="grid-stack-item" gs-w="3" gs-h="2">
          <div className="grid-stack-item-content"> <img width="100%" height="100%" src={Tema} /></div>
        </div>

        <div className="grid-stack-item" gs-w="3" gs-h="2">
          <div className="grid-stack-item-content"><div id="chart">
            <ReactApexChart options={this.state.options} series={this.state.series} type="area" height={350} />
          </div></div>
        </div>

        <div className="grid-stack-item" gs-w="3" gs-h="2">
          <div className="grid-stack-item-content">
            <ReactResizeDetector handleWidth handleHeight onResize={handleResize}>
              <HighchartsReact highcharts={Highcharts} options={getOptions('line')} />
            </ReactResizeDetector>
          </div>
        </div>
        <div className="grid-stack-item" gs-w="3" gs-h="2">
          <div className="grid-stack-item-content">
            <HighchartsReact highcharts={Highcharts} options={getOptions('spline')} /></div>
        </div>
        <div className="grid-stack-item" gs-w="3" gs-h="2">
          <div className="grid-stack-item-content">
            <HighchartsReact highcharts={Highcharts} options={getOptions('area')} /></div>
        </div>
        <div className="grid-stack-item" gs-w="3" gs-h="2">
          <div className="grid-stack-item-content">
            <HighchartsReact highcharts={Highcharts} options={getOptions('areaspline')} /></div>
        </div>
        <div className="grid-stack-item" gs-w="3" gs-h="2">
          <div className="grid-stack-item-content">
            <HighchartsReact highcharts={Highcharts} options={getOptions('column')} /></div>
        </div>
        <div className="grid-stack-item" gs-w="3" gs-h="2">
          <div className="grid-stack-item-content">
            <HighchartsReact highcharts={Highcharts} options={getOptions('bar')} /></div>
        </div>
        <div className="grid-stack-item" gs-w="3" gs-h="2">
          <div className="grid-stack-item-content">
            <HighchartsReact highcharts={Highcharts} options={getOptions('pie')} /></div>
        </div>
        <div className="grid-stack-item" gs-w="3" gs-h="2">
          <div className="grid-stack-item-content">
            <HighchartsReact highcharts={Highcharts} options={getOptions('scatter')} /></div>
        </div>

      </div>
    </div>
  );
}

export default App;
